import React from "react";
import "../App.css";

const KeyVending = ({ handleClick }) => {
  return (
    <div className="KeyVending">
      <button onClick={(e) => handleClick(e.target.value)}>A</button>
      <button onClick={(e) => handleClick(e.target.value)}>B</button>
      <button onClick={(e) => handleClick(e.target.value)}>C</button>
      <button onClick={(e) => handleClick(e.target.value)}>1</button>
      <button onClick={(e) => handleClick(e.target.value)}>2</button>
      <button onClick={(e) => handleClick(e.target.value)}>3</button>
    </div>
  );
};

export default KeyVending;
